// AT starting
/*
import React from "react";
import { Link } from "react-router-dom";
function Home(){
    return(
        <>
            <h1>Home</h1>
            <p>This is our Home page</p>
            <Link to="/about">Go to About Page</Link> <br/>
            <button>Go to About page</button> <br/>
            <button>Go to Filter page</button>

        </>
    )
}
*/

export default Home;
